import { actionsType } from '../actions'

const initialState = {
    data: []
}

const data = (state = initialState, action) => {
    switch (action.type){
        case actionsType.FETCH_DATA:
        return {
            ...state,
            data: action.data.data
        }
        default:
        return state;
    }
}

export {data}
